["Продаю ящик прессованный ПП, полипропилен на переработку.","Продаю со склада канистры ПНД из под грунтовки, из антисептика, незамерзайки, а так же брак с производства канистр. Сырье спрессовано в кипы по 300 кг. Марка исходного сырья 276. Канистры спрессованы в кипы, брак упакован в биг бэги. Также в наличии пленка ПНД упаковочная с магазинов и складов и другие полимерные отходы для вторичной переработки.","Продаю пленку ПВД упаковочную с магазинов и складов и другие полимерные отходы для вторичной переработки.","Полипропилен на переработку во вторичную гранулу. Постоянный объём в достаточном количестве.","Продаем ПП ящики. Цена с нашего места.","Продаю ПП ящики.","Сортировочный пункт продает канистры, ведра, бордюры, ПП ящики, Биг-Беги, Пэт, мешки, Пвх и т.д.","Продам ПП ящики, овощные сетки чёрного цвета.","Продаю ПП ящик прессованный.","Продам производственные отходы ПВД.","Продам производственные отходы спандбонда.","Продам прессованный спандбонд идеально чистый.","Продам отходы ПВД-пленки. Отходы чистые, складские, после переборки. Доставка по центральной части Москвы и Московской области.","Продам отходы ПНД-пленки. Отходы чистые, складские, после переборки. Доставка по центральной части Москвы и Московской области.","Продаём отходы ПВД + ПНД смешанные. Кипы от 100 кг. Отходы чистые, складские.","Продаем прессованные полипропиленовые ящики. Чистые без грязи и запаха. Отлично подойдет для переработки в гранулу. Кипы по 200 кг.","Продаем отходы стрейч-плёнки, чистая со склада.","Продам отходы ПП мешков под мойку на переработку из-под удобрений, сахара, соли, мела и ПВХ. Цвет белый. Хранение на складе. Постоянный объем.","Продам ПВД цветную пленку на переработку. Отход с магазинов в виде цветных термоусадочных пакетов. Материал чистый, сухой, складского хранения. Дешево.","Продам цветную ПВД пленку под мойку на переработку. Отходы с производства в виде пленки с утеплителя, термоусадочной пленки с паллет и вкладышей из биг-бегов.","Продам клееные ПП мешки из-под ПВХ.","Продам ПВД вкладыш из биг-бегов под мойку из-под соли, мела, соды, удобрений и ПВХ. Цвета: прозрачные, белые и цветные. Постоянный объем.","Продам отходы стрейч пленки со скотчем, магазинного и складского сбора. Постоянный объем. ","Продам отходы стрейч пленки под мойку (пыль), магазинного и складского сбора. Постоянный объем.","Продам ПВД пленку. Чистый материал, натурального цвета. Присутствуют этикетки. Срабатывается без мойки. Подходит под экструзию пакетов.","Продам чистые отходы стрейч пленки. Складской сбор. Постоянный и хороший объем.","Продам ПВХ пленку с мебельного производства. Чистая, без ламинации и скотча. Запрессована в тюки по 300кг - 400кг. Самовывоз.","Реализуем отходы ПВХ окон в качестве вторсырья.","На постоянной основе реализуем дробленку ПЭТ-флекс: чистая, сухая, без посторонних примесей, любого цвета. Собственное производство, большие объемы, любая форма оплаты. Расфасованы в биг-бэги по 400-500 кг. ","Продаем отходы пленки ПВД(термоусадочная плёнка, фасовочные пакеты, цветная пленка, целлофановая пленка, складские отходы стрейч-плёнки и пр.) для переработки. Имеется в наличии прозрачный и цветной полиэтилен в прессованном виде. Возможен самовывоз со склада поставщика или доставка нашим автотранспортом. Минимальный объем отгрузки - 1 тонна.","Продаем производственные отходы, остатки и брак ПВХ: ПВХ трубы, оконный и дверной профиль ПВХ и т. п. Отходы спрессованы в тюки и кипы. Доставка либо Вашими силами, либо мы доставим сами. Минимальный объем - 1 тонна.","Продам на постоянной основе чистые сухие отходы ПВД. Регулярный объем. ","Продам на постоянной основе чистые отходы стрейч. Регулярный объем. ","Продам биг-беги.","Продам стрейч.","Продам ПВД вкладыш, ПВД термоусадку.","Продам многослойную пленку ПВД+ПЭТ для переработки.","Продам ПНД пленку чистую для переработки.","Продам стрейч 1 сорта.","Продаем ПВД пленку цветную в роликах(брак производства).","Продам ПП ящики фруктовые, запрессованные.","Продам идеально прозрачный вкладыш биг-бега отсортированный.","Продам отходы ПЭТ бутылок. Сортированные и спрессованные в кипы. Прозрачные и цветные. Подойдет для производства технической тары, полимерного волокна. Различные формы оплаты. Стабильные объемы.","Продаем на постоянной основе пленку ПВД чистую на переработку, мойки не требует, объем большой, складской сбор, перебранная, тюки по 300-400 кг.","Продам отходы поликарбоната. Цвет- прозрачный. Литник, лист. Отходы с производства сотового ПК.","Продам производственные отходы мембранной пленки ПВД. Цена с НДС. ","Продам брак производства косметической тубы. Абсолютно чистый, цвет микс. Можем предложить в дробленом виде или в качестве брака изделий. Цена, соответственно, разная. Подходит на пленочную экструзию, толстостенную экструзию, литье.","Продам мешок полипропиленовый, из-под соли. Мойки не требует. Нить полимерная. Часть мешков с вкладышем ПВД (примерно 50%). Тюки в среднем по 150кг. С доставкой по Московской области. ","Продаем мягкий дробленный ПВХ - брак производства линолеума. Материал чистый, без клея, без подложки, без посторонних включений. Также предлагаем дробленку капельниц(мытые), прозрачные, на постоянной основе.","Продам дробленку ПВХ (дробился плинтус), цвет коричневый, мела менее 20%. Дробленка ПВХ белая, чистая, дробились пластиковые панели. Дробленка ПВХ профиля, мела 12,5% белая, чистая.","Продам пленку ПВД в роликах. Брак производства, чистая, не замутненная. Имеется двухслойная (ПВД/ПА)(62%/38%), трехслойная (ПВД/ПА/ПП).","Продам отходы полипропилена в виде мешков биг бэгов.","Продаем со склада в городе Чехов отходы ПВД. Постоянные объемы. Только складской и производственный сбор, никакой магазинки и уж точно никакого полигона. Сырье не требует мойки и дополнительной сортировки. Вся пленка запрессована в кипы от 240 кг до 350 кг. Сырье на любой вкус и цвет. Ищем постоянных партнеров на долгосрочной основе.","Продаем со склада в городе Чехов отходы ПНД. Постоянные объемы. Только складской и производственный сбор, никакой магазинки и уж точно никакого полигона. Сырье не требует мойки и дополнительной сортировки. Вся пленка запрессована в кипы от 240 кг до 350 кг. Сырье на любой вкус и цвет. Ищем постоянных партнеров на долгосрочной основе.","Продаем со склада в городе Чехов отходы стрейч. Постоянные объемы. Только складской и производственный сбор, никакой магазинки и уж точно никакого полигона. Сырье не требует мойки и дополнительной сортировки. Вся пленка запрессована в кипы от 240 кг до 350 кг. Сырье на любой вкус и цвет. Ищем постоянных партнеров на долгосрочной основе.","Продаем со склада в городе Чехов отходы ПП. Постоянные объемы. Только складской и производственный сбор, никакой магазинки и уж точно никакого полигона. Сырье не требует мойки и дополнительной сортировки. Вся пленка запрессована в кипы от 240 кг до 350 кг. Сырье на любой вкус и цвет. Ищем постоянных партнеров на долгосрочной основе.","Продаем со склада в городе Чехов отходы ПЭТ. Постоянные объемы. Только складской и производственный сбор, никакой магазинки и уж точно никакого полигона. Сырье не требует мойки и дополнительной сортировки. Вся пленка запрессована в кипы от 240 кг до 350 кг. Сырье на любой вкус и цвет. Ищем постоянных партнеров на долгосрочной основе.","Продаем дробленку ПВХ жесткого, брак производства панелей и профиля (оконных комплектующих). Белая, чистая, без посторонних включений и ламинации.","Продам обрезки пластика, ПВХ, оргстекло, полистирол, композитный материал.","Продам отходы стрейч пленки, складской сбор, постоянные объемы.","Продам мешки ПП из-под мела и доломитовой крошки. Мешки запрессованы в кипы.","Продам ПВД мешки из-под гранул. Все мешки чистые, не требуют мойки, запрессованы в кипы по 300кг. Самовывоз.","Продам биг бэги из-под гранул, чистые четырехстропные , запрессованы в кипы. Самовывоз.","Продам ПВД крышки от куллера. Крышки синего цвета, расфасованы в биг бэги , чистые. Самовывоз. ","Продам ПВД пленку в роликах на переработку. Пленка в роликах новая, прозрачная, без флексопечати , сделана из вторичного сырья(хорошего качества). Самовывоз.","Продам ПВД вкладыш из-под ПВХ.","Продам брак ПЭТ бутылок и преформ. Абсолютно чистое сырье , преформы и бутылки без этикеток, разделены по цветам.","Продам чистую ПНД пленку на переработку. Пленка чистая, прозрачная не требует мойки, запрессована в кипы. ","Продаем чистые отходы ПВД пленки.","Предлагаем отходы стрейч складской, прозрачной пленки на постоянной основе.","Продаём чистые прессованные и сортированные отходы стрейч плёнки. Ищем надёжных партнёров для долгосрочного сотрудничества.","Продам отходы стрейч пленки (складская, не сортировка), всегда есть в наличии.","Продам жесткие отходы ПВХ в виде новых изделий, в виде дробленки или в виде муки ПВХ. В очень большом количестве.","Продам отходы ванны флотации от ПЭТ бутылки. Содержание крышки 75%. Самовывоз Дедовск.","Продам, отдам почти даром технический ПЭТ из-под химии и из-под масла. ","Продам прессованные кипы из канистр и флакончиков, миксовано все вместе (встречается технический ПЭТ). Самовывоз Дедовск.","Продам ПЭТ бутылку с термоусадкой. Самовывоз Дедовск.","Продам вкладыши от Биг-бегов. Самовывоз Дедовск.","Продам ПЭТ бутылку полигон, микс, пресс, на постоянной основе.","Продам ПНД пленку прозрачную - брак производства.","Продам прессованные ящики ПП.","Продам ПНД поддоны черного цвета.","Продам прессованную ПНД канистру, большой объем. ","Продам пленку ПВХ от производства дверей.","Продам пленку ПВД: белую, цветную, черную под мойку.","Продам на постоянной основе ПЭТ-флекс всех цветов или микс. Поставки ежемесячно.","Продам ПНД-крошку (флакончики от быт. химии, йогурты) на постоянной основе. Также продадим дробленую пробку."],
