["Куплю спандбонд.","Куплю трубу ПНД.","Куплю трубу ПНД.","Куплю отходы стрейч пленки.","Покупаем отходы пленки ПВД и др. полимерные отходы в больших объемах.","Покупаем отходы пленки стрейч, и др. полимерные отходы в больших объемах.","Покупаем отходы ящиков ПНД, канистр, флаконов и др. полимерных отходов в больших объемах.","Покупаем отходы ящиков ПП, канистр, флаконов и др. полимерных отходов в больших объемах.","Куплю отходы стрейч, ПОФ.","Куплю отходы стрейч, ПВД, вспененный ПВД.","Куплю производственные отходы, брак: PP, ПП, Полипропилена.","Куплю биг беги б/у в прессованном виде и навалом, резанные и целые. Цена напрямую зависит от качества и объема материала. Оплата любым удобным для Вас способом.","Куплю пластиковые паллеты.","Покупаем стрейч пленку для переработки. Ищем долгосрочное сотрудничество на выгодных условиях. Чем чище пленка, тем дороже мы её заберем.","Покупаем ПВД пленку для переработки. Ищем долгосрочное сотрудничество на выгодных условиях. Чем чище пленка, тем дороже мы её заберем.","Закупаем складские отходы стрейч пленки.","Закупаем производственные отходы пленки ПВД.","Закупаем производственные отходы пленки ПНД.","Закупаем  упаковочную полипропиленовую пленку ПП, в роликах с флексопечатью, полипропиленовые мешки( Биг-Бэг МКР).","Куплю канистры из-под масла, тосола, антифриза, концентратов.","Куплю овощные ящики.","На постоянной основе покупаем ПНД канистры, ящики, трубы, градирни, капельное орошение и т. п. В том числе полигон. Безнал с НДС и без. ","Купим упаковочную пленку ПНД для переработки. Рассматриваем все возможные варианты сотрудничества.","Купим упаковочную пленку стрейч для переработки. Рассматриваем все возможные варианты сотрудничества.","Купим упаковочную пленку ПВД для переработки. Рассматриваем все возможные варианты сотрудничества.","Куплю отходы пленки ПВД с производств, складов, торговых площадок. Заинтересованны в постоянных объемах. Цена отходов пленки зависит от чистоты и объема.","Куплю отходы стрейч пленки на переработку, осуществляем вывоз отходов стрейч с производств, складов, торговых площадок. Заинтерессованны в постоянных объемах. Цена отходов пленки зависит от чистоты и объема.","Куплю отходы  полипропилена(ПП, PP), с производств, складов, торговых площадок. Заинтерессованны в постоянных объемах отходов стрейч пленки. Цена отходов пленки зависит от чистоты и объема.","На постоянной основе куплю отходы овощных и пивных ящиков, обреки и литники продукции, брак производства, также куплю отходы АБС, полистирола, пластика, производственные отходы ПВХ, дробленку. Самовывоз полимерных отходов своим транспортом. Покупка полимерных отходов и отходов пленки за наличный расчет по факту поставки.","Купим запрессованные отходы стрейч пленки. Пленка, по возможности, должна быть отсортировна по видам, без мусора, бумажных этикеток, не должна содержать органических загрязнений. Стоимость приемки зависит от количества и качества (чистоты) сдаваемых отходов. Запресованные отходы вывезем своей машиной.","Купим запрессованные отходы пленки ПНД. Пленка, по возможности, должна быть отсортировна по видам, без мусора, бумажных этикеток, не должна содержать органических загрязнений. Стоимость приемки зависит от количества и качества (чистоты) сдаваемых отходов. Запресованные отходы вывезем своей машиной.","Купим запрессованные отходы пленки ПВД. Пленка, по возможности, должна быть отсортировна по видам, без мусора, бумажных этикеток, не должна содержать органических загрязнений. Стоимость приемки зависит от количества и качества (чистоты) сдаваемых отходов. Запресованные отходы вывезем своей машиной.","Покупаем биг-беги и ПП мешки(на 50 и 25кг) из-под сыпучего сырья, кварцевого песка, соли, сода шпата, химического сырья, полимерной гранулы, удобрений, цемента и др. В прессованном виде и россыпью. Не принимаются мешки, имеющие сильные (несмываемые) загрязнения, от сажи, графита, резиновой крошки, металла, ядовитых и химически опасных веществ. Оплата без задержек.","Постоянно закупаем ПЭТ бутылку голубого, прозрачного, коричневого и зеленого цветов на переработку. Покупаем ПЭТ преформы тех же цветов по более высокой цене. Бутылка принимается как в прессованном, так и не прессованном виде. Допускается наличие этикетки(закрывает не более 50% бутылки) и крышки. Не принимаются бутылки из-под масла, молочного белого и других нестандартных цветов. Возможен прием ПЭТ пленок в качестве сырья на переработку. Пожалуйста звоните и уточняйте цену на свой материал.","Купим отходы стрейч пленки. Вывезем своим транспортом в удобное для Вас время. Оплата сразу, любым удобным для Вас способом.","Купим пластиковые канистры ПНД в любом виде: прессованные и россыпью. Не принимаются канистры из-под красок и ядовитых/опасных/вредных веществ. Возможен самовывоз нашим транспортом. Оплата любым способом - сразу.","Купим трубы ПНД: водопроводные, газовые, питьевые, лежалые 12 метров, обрезки, брак, и т. д.  Возможен самовывоз. Оплата любым способом. ","Куплю отходы стрейч пленки - магазинный сбор или складской. Полигон - не предлагать. Без запаха. Без органический или масляных загрязнений. Заберем своим транспортом. Постоянным клиентами особые условия работы. Возможна установка пресса для запрессовки стрейча от 3 тонн ежемесячно, на выгодных условиях.","Куплю пластиковые ящики, куплю поддоны из пластика, куплю канистры пластиковые. Оплата нал/безнал. Самовывоз.","Купим Ваши производственные отходы ПНД. Самовывоз. Рассмотрим любые предложения по закупке полимеров. Предоплата на последующие поставки. Высокие закупочные цены. ","Купим Ваши производственные отходы ПВД. Самовывоз. Рассмотрим любые предложения по закупке полимеров. Предоплата на последующие поставки. Высокие закупочные цены. ","Купим Ваши производственные отходы полипропилена. Самовывоз. Рассмотрим любые предложения по закупке полимеров. Предоплата на последующие поставки. Высокие закупочные цены. ","Купим Ваши производственные отходы ПЭТ. Самовывоз. Рассмотрим любые предложения по закупке полимеров. Предоплата на последующие поставки. Высокие закупочные цены. ","Купим Ваши производственные отходы полистирола , полиамида , поликарбоната. Самовывоз. Рассмотрим любые предложения по закупке полимеров. Предоплата на последующие поставки. Высокие закупочные цены. ","Покупаем стрейч плёнку.","Покупаем биг беги.","Куплю ПЭТ б/у пресованная (без молочки и масляных бутылок). Покупаю микс, прозрачно-голубой (+3 руб. за кг), коричнево-зеленой (+2 руб.). Ваша доставка в МО (Сходня). ","Купим отходы пленки ПВД. ","Закупаем чистые, производственные отходы ПВХ в виде дроблёнки, обрезков оконного профиля, брака производства, и прочее в неограниченном объёме. Оплата в удобной для вас форме. Вывоз от 600 кг.","Покупаем канистры б/у по Москве и области для переработки. Вывозим оперативно в кратчайшие сроки. ","Покупаем отходы складской стрейч пленки в чистом виде без содержания скотча и бумажных этикеток.","Покупаем биг беги б/у в Москве по самым выгодным ценам.","Куплю отходов полиэтилена в виде пленки. Покупаем пленку ПВД для переработки. Вывозим от 300 кг.","Покупаю брак пластиковых изделий, трубы, листы, вырубку, некондицию пластмассовых изделий.","Куплю чистые отходы полипропилена: плёнка, вёдра, мешки, изделия, ящик(колбасный, молочный, вино-водочный).","Покупаю отходы пленок ПВД, брак производства - прессованный или в рулонах.  ","Покупаю отходы пленок ПНД, брак производства - прессованные или в рулонах. ","Куплю отходы ПЭТ бутылки. ","Покупаю отходы биг-бэгов. ","Куплю отходы ПП в виде: ящиков, поддонов, дробленки, полипроленовых листов, пленки БОПП, гранул ПП, пищевых ведер, ленты ПП, и ПП мешков. ","Закупаем большие объемы стрейч пленки в чистом, прессованном в кипы, виде. Вывозим своим транспортом со склада поставщика. Форма оплаты любая. ","Закупаем на постоянной основе чистую ПВД термоусадочную пленку, прозрачную и цветную. Вывоз пленки осуществляется своим транспортом. Форма оплаты любая. Оплата по факту загрузки.","На постоянной основе закупаем большие объемы чистых ПНД ящиков. Самовывоз из любого города. Форма оплаты - любая.","На постоянной основе закупаем большие объемы чистых ПП ящиков. Самовывоз из любого города. Форма оплаты - любая.","Покупаем отходы  пленки ПНД. Требуются большие объемы. Предпочтение отдается чистым отходам производств, спрессованным в кипы и россыпью.","Покупаем отходы  пленки ПВД. Требуются большие объемы. Предпочтение отдается чистым отходам производств, спрессованным в кипы и россыпью.","Покупаем отходы, брак, лом, дроблёнку, неликвиды полипропилена (ПП).","Покупаем отходы, брак, лом, дроблёнку, неликвиды ПНД.","Покупаем отходы, брак, лом, дроблёнку, неликвиды ПВД.","Покупаем отходы, брак, лом, дроблёнку, неликвиды полистирола (УПС, УПМ, ПСС, ПСМ).","На постоянной основе покупаем отходы полистирольной группы - АБС и ПС пластика: брак изделий, сами изделия, литник, дробленку, слитки, пусковые и другое. Рассматриваем все марки и варианты предлагаемого сырья независимо от объёма и цены.","Покупаем ПНД: ящики, канистры, бочки, обрезки, литники, трубы, ящик винно-водочный, пивной, сетку ограждение, поддоны пластиковые, отводы. Поставщикам предлагаем стабильные объемы, своевременную оплату, любые условия оплаты. Самовывоз.","Покупаем ПВД: ящики, канистры, бочки, обрезки, литники, трубы, ящик винно-водочный, пивной, сетку ограждение, поддоны пластиковые, отводы. Поставщикам предлагаем стабильные объемы, своевременную оплату, любые условия оплаты. Самовывоз.","На постоянной основе покупаем мягкие отходы полиэтилена высокого давления, ПВД всех марок. В виде пленок, вкладышей, брак с производства, литники, изделия, складские сборы и остатки. Рассмотрю любые предложения, самовывоз, любая форма оплаты.","Закупаем производственные отходы PP, ПП, полипропилена (брак, вырубка, литники, отходы изделий, изделия, складские остатки). Будем рады взаимовыгодным партнерским отношениям. Рассматриваем любые предложения сотрудничества.","Закупаем вкладыш ПВД для переработки. Принимаем прессованные и валом. Вывоз осуществляем свои транспортом. Будем рады долгосрочному сотрудничеству.","Закупаем отходы пленки ПВД, интересуют большие объемы, предпочтение отдается чистым отходам. Ищем постоянных поставщиков на долгосрочные взаимоотношения.","Закупаем отходы пленки ПНД, интересуют большие объемы, предпочтение отдается чистым отходам. Ищем постоянных поставщиков на долгосрочные взаимоотношения.","Закупаем отходы стрейч пленки, интересуют большие объемы, предпочтение отдается чистым отходам. Ищем постоянных поставщиков на долгосрочные взаимоотношения.","Купим пластиковые канистры б/у или бочки - любые. Запрессовка - необязательна. Принимаем россыпь. Вывоз нашим транспортом, оперативно. Оплата по факту взвешивания любым удобным для Вас способом. Не принимаются канистры: из под лакокрасочных материалов, ядов, веществ с которыми нельзя работать без средств защиты.","Предприятие осуществляет покупку полиэтиленовых бу труб ПНД водонапорных, газовых, питьевых, в виде брака, обрезков, не кондиции. Цена зависит от объема и качества труб. Отходы труб необходимы для вторичной переработки. Любая форма оплаты. Возможен самовывоз.","Куплю ведро ПП из-под молочных продуктов для переработки.","Куплю трубу ПНД для переработки.","На постоянной основе покупаем биг бэги на переработку, 2-х и 4-х стропные. Большие объемы переработки. Безнал.","Куплю ПНД канистру. Оплата сразу по факту загрузки наличкой.","Куплю пленку ПВД.","Куплю пленку стрейч.","Куплю ящики ПП, дробленку, ведра ПП.","Дорого куплю чистый сортированный стрейч.","Куплю ПЭТ молочку отходы.","Куплю сотовый ПП.","Куплю в больших обьёмах  ПВД.","Куплю ПНД в больших обьёмах.","Куплю полистирол, поликарбонат и другое в больших обьёмах.","Купим дорого отсортированную плёнку стрейч.","Куплю чистые отходы ПВД.","Приобретём чистые, производственные отходы ПНД в виде дроблёнки, литников, сливов, обрези, канистры, бочек, ящиков, поддонов, труб, флакончиков.Оплата в удобной для вас форме.","Приобретём на переработку чистые, производственные отходы полипропилена в виде дроблёнки, пленки, обрезков кромки полотна, литников, отходы формовки, брак производства, спанбонд и прочее в неограниченном объёме. Оплата в удобной для вас форме.","Закупаем чистые отходы полистирола в виде дроблёнки, изделий, вырубки, листов и прочего.",],
